import React from "react";
import styled from "styled-components";
// css
const HeaderContaner = styled.div`
  background: red;
  margin: 0 auto;
  padding: 0 auto;
  ${"" /* width: 100%; */}
  display: flex;
  justify-content: space-around;

  ul {
    list-style: none;
    display: flex;
    justify-content: space-between;
  }
`;

function Header() {
  return (
    <HeaderContaner>
      <h2>Gurules</h2>
      <ul>
        <li>About</li>
        <li>Find Tutor</li>
        <li>Contact</li>
        <li>Dashboard</li>
        <li>Login</li>
      </ul>
    </HeaderContaner>
  );
}

export default Header;
